import React from 'react'
import { Link } from 'react-router-dom'
import Authoption from '../auth/Authoption'

export default function Header() {
    return (
        <div id='header'>
           <Link to='/'>
                       <h1 className='mern'>MERN auth template</h1>  
           </Link>
            <Authoption/>
        </div>
    )
}
